osm.addTo(map);



var linedata = L.geoJSON(lineJSON);


var layerscontrol, bus_route;

var polygondata = L.geoJSON(lineJSON, {
    style: style,
    onEachFeature: onEachFeature,

}).addTo(map);


function update_layers(polygonJSON, bus_route) {
    map.removeLayer(polygondata);
    polygondata = L.geoJSON(polygonJSON, {
        style: style,
        onEachFeature: onEachFeature,


    }).addTo(map);

    var overlays = {
        "A2 Bus Route": bus_route,
        "AQI": polygondata,

    };
    console.log(layerscontrol);
    if (layerscontrol) {
        layerscontrol.remove(map);
        layerscontrol = L.control.layers(null, overlays, { position: 'topright' }).addTo(map);
    }
    else {
        layerscontrol = L.control.layers(null, overlays, { position: 'topright' }).addTo(map);
    }
}




function getColor(d) {
    return d > 300 ? '#BD0026' :
        d > 200 ? '#E31A1C' :
            d > 150 ? '#FC4E2A' :
                d > 100 ? '#FD8D3C' :
                    d > 50 ? '#FEB24C' :
                        d > 0 ? '#FED976' :
                            '#FFEDA0';
}

function style(feature) {
    return {
        fillColor: getColor(feature.properties.aqi),
        weight: 2,
        opacity: 1,
        color: 'white',
        dashArray: '3',
        fillOpacity: 0.9
    };
}


function highlightFeature(e) {
    var layer = e.target;

    layer.setStyle({
        weight: 5,
        color: '#666',
        dashArray: '',
        fillOpacity: 1
    });
    info.update(layer.feature.properties);

}

function resetHighlight(e) {
    polygondata.resetStyle(e.target);
    info.update();
}


function zoomToFeature(e) {
    map.fitBounds(e.target.getBounds());
    if (e.latlng in polygonJSON["muharraq"])
        alert("Clicked muharraq");
}

function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
        click: zoomToFeature,
    });
    layer.on({
        'add': function () {
            layer.bringToBack()
        }
    });
}



var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'mapinfo'); // create a div with a class "mapinfo"
    this.update();
    return this._div;
};

// method that we will use to update the control based on feature properties passed
info.update = function (props) {
    this._div.innerHTML =  (props ?
        '<b>' + props.name + ' </b><br />AQI: ' + props.aqi :
        'Hover over a Governerate');
};

info.addTo(map);

var legend = L.control({ position: 'bottomright' });

legend.onAdd = function (map) {

    var div = L.DomUtil.create('div', 'info legend'),
        grades = [0, 50, 100, 150, 200, 300];

    // loop through our density intervals and generate a label with a colored square for each interval
    for (var i = 0; i < grades.length; i++) {
        div.innerHTML +=
            '<i style="background:' + getColor(grades[i] + 1) + '"></i> ' +
            (grades[i] + 1) + (grades[i + 1] ? '&ndash;' + grades[i + 1] + '<br>' : '+');
    }

    return div;
};

